export async function getStaticProps(context) {
  const pokemon = await fetch('https://pokeapi.co/api/v2/pokedex/2/')
      .then(res => {
        if(res.ok) {
          console.log(res)
          return res.json()
        }
      })
      .then(res => {
        return res.pokemon_entries
      })
  return {
    props: {pokemon}, // will be passed to the page component as props
  }
}
